import React, { useEffect, useState } from "react";

const MyTickets = () => {
  const [tickets, setTickets] = useState([]);

  useEffect(() => {
    // ðŸ”§ TEST : Injecter un ticket dans le localStorage
    const testTickets = [
      {
        id: 1,
        title: "Connexion impossible Ã  STB",
        status: "En attente",
        priority: "Moyenne",
        createdAt: "2025-04-22",
        updatedAt: "2025-04-22",
      },
    ];

    localStorage.setItem("tickets", JSON.stringify(testTickets));
    setTickets(testTickets);
  }, []);

  return (
    <div style={{ padding: "2rem" }}>
      <h2 style={{ fontSize: "24px", fontWeight: "bold", marginBottom: "1rem" }}>
        Mes Tickets
      </h2>
      <table style={{ width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr>
            <th style={styles.th}>ID</th>
            <th style={styles.th}>Titre</th>
            <th style={styles.th}>Statut</th>
            <th style={styles.th}>PrioritÃ©</th>
            <th style={styles.th}>CrÃ©Ã© le</th>
            <th style={styles.th}>Mis Ã  jour le</th>
          </tr>
        </thead>
        <tbody>
          {tickets.map((ticket) => (
            <tr key={ticket.id}>
              <td style={styles.td}>{ticket.id}</td>
              <td style={styles.td}>{ticket.title}</td>
              <td style={styles.td}>{ticket.status}</td>
              <td style={styles.td}>{ticket.priority}</td>
              <td style={styles.td}>{ticket.createdAt}</td>
              <td style={styles.td}>{ticket.updatedAt}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const styles = {
  th: {
    border: "1px solid #ddd",
    padding: "8px",
    backgroundColor: "#f4f4f4",
    fontWeight: "bold",
  },
  td: {
    border: "1px solid #ddd",
    padding: "8px",
    textAlign: "center",
  },
};

export default MyTickets;
